import React from 'react';


function Navbar(){



    return(
      <nav className="navbar navbar-dark bg-dark mb-3">
        <li><a href="/" className>Dashboard</a></li>
        <li><a href="/register">Register</a></li>
        <li><a href="/login">Login</a></li>
      </nav>
    );
}

export default Navbar;
